import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const dadosIniciais = {
  nome: 'João Silva',
  email: 'joao@example.com',
  senha: '********',
  telefone: '(11) 99999-9999',
  faculdade: 'Sim',
  trabalha: 'Sim',
  area: 'Desenvolvimento',
};

const areas = [
  'Desenvolvimento',
  'Design',
  'Gestão',
  'Marketing',
  'QA',
  'Outro',
];

const Perfil = () => {
  const navigate = useNavigate();
  const [editando, setEditando] = useState(false);
  const [formData, setFormData] = useState(dadosIniciais);
  const [senhaVisivel, setSenhaVisivel] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleVoltar = () => {
    navigate(-1);
  };

  const handleEditar = () => {
    setEditando(true);
  };

  const handleCancelar = () => {
    setFormData(dadosIniciais);
    setEditando(false);
  };

  const handleSalvar = (e) => {
    e.preventDefault();
    alert('Informações salvas com sucesso!');
    setEditando(false);
  };

  return (
    <div className="px-40 flex flex-1 justify-center py-5">
      <div className="layout-content-container flex flex-col w-[512px] max-w-[512px] py-5 max-w-[960px] flex-1">
        <div className="flex flex-wrap justify-between gap-3 p-4">
          <p className="text-[#0d141c] tracking-light text-[32px] font-bold leading-tight min-w-72">Perfil do Usuário</p>
        </div>
        <form onSubmit={handleSalvar}>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Nome</p>
              <input
                name="nome"
                value={formData.nome}
                onChange={handleInputChange}
                disabled={!editando}
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
              />
            </label>
          </div>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Email</p>
              <input
                name="email"
                type="email"
                value={formData.email}
                onChange={handleInputChange}
                disabled={!editando}
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
              />
            </label>
          </div>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Senha</p>
              <div className="flex items-center gap-2">
                <input
                  name="senha"
                  type={senhaVisivel ? 'text' : 'password'}
                  value={formData.senha}
                  onChange={handleInputChange}
                  disabled={!editando}
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
                />
                {editando && (
                  <button type="button" onClick={() => setSenhaVisivel((v) => !v)} className="text-[#0c7ff2] text-xs font-bold px-2">
                    {senhaVisivel ? 'Ocultar' : 'Mostrar'}
                  </button>
                )}
              </div>
            </label>
          </div>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Telefone</p>
              <input
                name="telefone"
                value={formData.telefone}
                onChange={handleInputChange}
                disabled={!editando}
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
              />
            </label>
          </div>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Faz faculdade?</p>
              <select
                name="faculdade"
                value={formData.faculdade}
                onChange={handleInputChange}
                disabled={!editando}
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
              >
                <option value="Sim">Sim</option>
                <option value="Não">Não</option>
              </select>
            </label>
          </div>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Trabalha?</p>
              <select
                name="trabalha"
                value={formData.trabalha}
                onChange={handleInputChange}
                disabled={!editando}
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
              >
                <option value="Sim">Sim</option>
                <option value="Não">Não</option>
              </select>
            </label>
          </div>
          <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
            <label className="flex flex-col min-w-40 flex-1">
              <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Área de atuação</p>
              <select
                name="area"
                value={formData.area}
                onChange={handleInputChange}
                disabled={!editando}
                className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-lg text-[#0d141c] focus:outline-0 focus:ring-0 border border-[#cedbe8] bg-slate-50 focus:border-[#cedbe8] h-14 placeholder:text-[#49739c] p-[15px] text-base font-normal leading-normal disabled:bg-[#f1f5f9]"
              >
                {areas.map((area) => (
                  <option key={area} value={area}>{area}</option>
                ))}
              </select>
            </label>
          </div>
          <div className="flex gap-3 flex-wrap px-4 py-3 justify-end">
            <button
              type="button"
              onClick={handleVoltar}
              className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-10 px-4 bg-[#e7edf4] text-[#0d141c] text-sm font-bold leading-normal tracking-[0.015em] hover:bg-[#d0dae5] transition-colors"
            >
              Voltar
            </button>
            {!editando && (
              <button
                type="button"
                onClick={handleEditar}
                className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-10 px-4 bg-[#0c7ff2] text-slate-50 text-sm font-bold leading-normal tracking-[0.015em] hover:bg-[#0a6cd9] transition-colors"
              >
                Editar
              </button>
            )}
            {editando && (
              <>
                <button
                  type="button"
                  onClick={handleCancelar}
                  className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-10 px-4 bg-[#e7edf4] text-[#0d141c] text-sm font-bold leading-normal tracking-[0.015em] hover:bg-[#d0dae5] transition-colors"
                >
                  Cancelar
                </button>
                <button
                  type="submit"
                  className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-10 px-4 bg-[#16a34a] text-slate-50 text-sm font-bold leading-normal tracking-[0.015em] hover:bg-[#15803d] transition-colors"
                >
                  Salvar
                </button>
              </>
            )}
          </div>
        </form>
      </div>
    </div>
  );
};

export default Perfil;
